import React from 'react';
import '../../App.css';
import Footer from '../footer/Footer';
import PieChart from './mainpages/chart/Chart'


export default function About() {
    return <>
        <div className='yugitoken'>
            <div className="heading white-heading">YGO TOKEN</div>
        </div>
        <PieChart />
        <Footer />
    </>;
}
